import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and fill with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after filling search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using multiple selector strategies
    const searchButton = await page.$('.search-btn');
    if (searchButton) {
      await searchButton.click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for results and take screenshot
    await page.waitForSelector('.product-card, .search-results, .no-results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = {};
    const resultsCount = await page.$eval('.results-count', el => el.textContent).catch(() => 'N/A');
    extractedData.resultsCount = resultsCount;

    // Get product titles
    const productTitles = await page.$$eval('.product-title', titles => 
      titles.slice(0, 5).map(t => t.textContent.trim())
    ).catch(() => []);
    extractedData.productTitles = productTitles;

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for iPhone products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
